import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import AtheleteMenu from "../components/layout/AtheleteMenu";

const AtheProfile = () => {
  return (
    <AtheleteMenu>
      <section style={{ width: "80vh" }}>
        <Container>
          <Row>
            <Col className="d-flex ">
              <img
                src="/images/sample.svg"
                style={{ border: "3px solid purple", borderRadius: "50%" }}
              />
              <div className="d-flex align-self-center flex-column m-5">
                <h2>Mobina Mirbagheri</h2>
                <p>Your account is ready</p>
              </div>
            </Col>
          </Row>
          <Row>
            <Col sm={2}></Col>
            <Col sm={10}>
              <Col></Col>
              <Col></Col>
            </Col>
          </Row>
        </Container>
      </section>
    </AtheleteMenu>
  );
};

export default AtheProfile;
